    MiniUI.Name = "MiniUI"
    MiniUI.Size = UDim2.new(0, 50, 0, 50)
    MiniUI.Position = UDim2.new(0, SCREEN_WIDTH - 100, 0, 10)
    MiniUI.BackgroundColor3 = Color3.fromRGB(45, 45, 50)
